import React, { Component } from 'react';
import './task-filter.css';

export default class TaskFilter extends Component {
  render() {
    const { filterChange, statusFilter } = this.props;
    return (
      <ul className="filters">
        <li>
          <button
            className={statusFilter === 'All' ? 'selected' : ''}
            onClick={() => filterChange('All')}
          >
            All
          </button>
        </li>
        <li>
          <button
            className={statusFilter === 'Active' ? 'selected' : ''}
            onClick={() => filterChange('Active')}
          >
            Active
          </button>
        </li>
        <li>
          <button
            className={statusFilter === 'Completed' ? 'selected' : ''}
            onClick={() => filterChange('Completed')}
          >
            Completed
          </button>
        </li>
      </ul>
    );
  }
}

TaskFilter.defaultProps = {
  statusFilter: 'All',
};
